-- Drop table

-- DROP TABLE episode.navigator;

CREATE TABLE episode.navigator (
	id int4 NOT NULL,
	org_id varchar(20) NOT NULL,
	parent varchar(30) NULL,
	navigator_id varchar(30) NOT NULL,
	status varchar(10) NOT NULL,
	"type" varchar(10) NOT NULL,
	description varchar(50) NOT NULL,
	hierarchypath varchar(100) NULL,
	navigatoricon varchar(20) NULL,
	order_seq int4 NULL DEFAULT 0,
	create_dt timestamp NOT NULL DEFAULT timezone('utc'::text, CURRENT_TIMESTAMP),
	create_id varchar(20) NOT NULL,
	update_dt timestamp NOT NULL DEFAULT timezone('utc'::text, CURRENT_TIMESTAMP),
	update_id varchar(20) NOT NULL,
	navigatoriconsvg text NULL,
	CONSTRAINT navigator_idx1 PRIMARY KEY (id),
	CONSTRAINT navigator_idx2 UNIQUE (org_id, navigator_id)
);
CREATE INDEX navigator_idx3 ON episode.navigator USING btree (org_id, parent);

-- Permissions

ALTER TABLE episode.navigator OWNER TO episode;
GRANT ALL ON TABLE episode.navigator TO episode;

